import { View } from 'react-native'
import ThemedText from '../ThemedText'

const ReviewItem = ({ review }) => {
	return (
		<View style={{width: 200, borderRadius: 100}}>
			<ThemedText
				color='primary'
				fontWeight='bold'
				fontSize='subheading'
			>
				{review.rating}
			</ThemedText>
		</View>
	)
}

export default ReviewItem
